import mPrf from "./FindDoctorSearch/docprofileml.svg";

import React, { useEffect, useState } from 'react'

const BookingConsultation = () => {
    const [searchParams] = useSearchParams();
    const searchedDoctorsSpecialty = searchParams.get('specialty')
    const handleSearch = () =>{
        console.log("GOT CLICKED")
    }


    const getDoctorsDetails = async (searchedDoctorsSpecialty) => {
            const response = await fetch ("https://api.npoint.io/9a5543d36f1460da2f63",
            {
                method: "GET", // *GET, POST, PUT, DELETE, etc.
                // mode: "cors", // no-cors, *cors, same-origin
